    protected override async Task OnInitializedAsync()
    {
        try
        {
            providers = _provider.GetAll(false).Data;
        }
        catch (Exception e)
        {

            Message = "Imposible obtener lista de proveedores";
        }
    }

    private void SetProvider(ChangeEventArgs e)
    {
        oRawMaterial.ProviderId = Int32.Parse(e.Value.ToString());
    }

    private void Save()
    {
        try
        {
            var actionResponse = _router.Insert(oRawMaterial);

            if (actionResponse.IsSuccess)
            {
                NavManager.NavigateTo("RawMaterials/Index");
            }
            else
            {
                Message = actionResponse.Message;
            }
        }
        catch (Exception e)
        {

            Message = e.Message;
        }

    }

